import React from 'react';
import { Button } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles'
import ArrowDownwardIcon from '@material-ui/icons/ArrowDownward';


const useStyles = makeStyles((theme) => ({
    buttonContainerStyles: {
        position: 'relative',
        width: '150px',
        height: '300px',
        left: "-38px",
        marginTop: '50px',
        margin: '0 auto',
        textAlign: 'center',
    },

    buttonStyles:{
        fontSize: '25px',
        border: 'solid 1px black',
        borderRadius: '15%',
        backgroundColor: 'black',
        color: 'rgb(228, 130, 74)',
        textTransform: 'none',
        '&:hover': {
            marginBottom: '450px',
            border: 'solid 2px rgb(228, 130, 74)',
            background: '#000000'
        }
    },
    arrowStyles:{
        fontSize: '100px',
        marginLeft: '5px'
    }
    
}));

const SeeProjects = () => {
    
    
    const classes =  useStyles();
    return(
        <div className={classes.buttonContainerStyles}>
            <Button className={classes.buttonStyles}  >See <br></br>Projects</Button>
            <br></br>
            <ArrowDownwardIcon className={classes.arrowStyles} />
        </div>
    )
}


export default SeeProjects;
